import React from 'react';
import ReactDOM from 'react-dom';
import FaceTwoToneIcon from '@material-ui/icons/FaceTwoTone';

const styles = theme => ({
  smallButton: {
    padding: 6
  },
  largeButton: {
    padding: 24
  },
  largeIcon: {
    fontSize: "3em"
  },
  input: {
    display: "none"
  }
});

function SvgIconsSize(props) {
const { classes } = props;

  return (
	<div>
		<FaceTwoToneIcon fontSize="large" />
		<FaceTwoToneIcon className={classes.largeIcon} />
	</div>
);
}

ReactDOM.render(
  // Try changing to isLoggedIn={true}:
  <SvgIconsSize />,
  document.getElementById('root')
);
